description:
Verenigde Staten
Horror / Thriller
95 minuten

goed

met Nicholas D'Agosto, Emma Bell en Tony Todd

Het voorgevoel van een man (Nicholas D'Agosto) redt een groep collega's van een instortende hangbrug. Maar het was niet de 
bedoeling dat deze groep nietsvermoedende zielen dit zou overleven. In een race tegen de klok doet de onfortuinlijke groep 
verwoede pogingen om een manier te ontdekken om uit de sinistere agenda van de dood te ontsnappen.
